  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="ul" components={components}>
<MDXTag name="li" components={components} parentName="ul">import { Analytics } from '../Analytics';
Analytics.page(window.location.pathname)</MDXTag>
</MDXTag>
<MDXTag name="h1" components={components} props={{"id":"getting-started"}}>{`Getting started`}</MDXTag>
<MDXTag name="p" components={components}>{`Visual editor is available here:`}</MDXTag>
<MDXTag name="p" components={components}><MDXTag name="a" components={components} parentName="p" props={{"href":"https://app.graphqleditor.com"}}>{`https://app.graphqleditor.com`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}>{`Have you ever used spacebar menu in graphics realted software ? No?
Here is a short tutorial on how to use this kind of menu.`}</MDXTag>
<MDXTag name="p" components={components}>{`IMPORTANT: To open menu `}<MDXTag name="strong" components={components} parentName="p">{`press and hold spacebar`}</MDXTag>{` anywhere inside the diagram`}</MDXTag>
<video autoPlay={true} controls style={{
    maxWidth:'100%'
}} src={require("./space.mp4")} />
           </MDXTag>
  }
}
